Dans les langages fonctionnels, les fonctions sont des valeurs au même titre que les entiers, les flottants, les caractères, etc . Regardons ce qui se passe lorsqu'on évalue simplement sqrt. # sqrt;;
- : float -> float = <fun> On découvre que le type de sqrt est float -> float ce qui signifie que cette valeur est une fonction prenant en entré un paramètre de type flottant et retournant en sortie une valeur de type flottant. Comme la valeur d'une fonction ne peut être affichée simplement sur le terminal, OCaml dit que la valeur est <fun> signifiant que c'est une fonction. Que se passe-t-il alors si on évalue sqrt 16 ? # sqrt 16;;
Error: This expression has type int but an expression was expected of type float Hint: Did you mean `16.'? OCaml étant un langage fortement typé, il déclenche une erreur car sqrt attend une valeur de type float en entrée et qu'une valeur de type int a été incorrectement utilisée. Cela peut paraître contraignant au premier abord mais le typage fort permet d'éliminer un grand nombre de bugs dès la compilation. On peut retenir les deux points suivants sur le système de typage de OCaml: OCaml n'effectuera jamais de conversion de type implicite à votre place Chaque fonction a une signature unique qui doit être respectée à chaque appel : il n'y a pas de surcharges de fonctions en OCaml Cela explique aussi pourquoi nous avons utilisé l'opérateur -. pour soustraire les deux flottants et non pas l'opérateur - qui soustrait deux entiers.

