Comme OCaml est fortement typé, toute expression possède un type, et les expressions conditionnelles n'échappent pas à cette règle. Il n'est par exemple pas possible d'écrire : if 72 > 35 then 7 else 3.5;; Nous obtenons la réponse suivante : # if 72 > 35 then 7 else 3.5;;
Error: This expression has type float but an expression was expected of type int En effet, OCaml n'est pas capable de déterminer le type de cette expression conditionnelle qui pourrait être évaluée à 7 de type int ou 3.5 de type float, cela conduit à une erreur de typage. Cela arrive même lorsque le résultat du test pourrait être prédit à l'avance comme c'est le cas ici. La règle est donc la suivante : expr_vrai et expr_faux doivent être de même type . Pour la même raison, il n'est pas possible d'avoir un if qui ne contient pas de else : # if 3 > 8 then 71;;
Error: This expression has type int but an expression was expected of type unit because it is in the result of a conditional with no else branch En effet, cette expression doit nécessairement avoir une valeur en OCaml dont le else est nécessaire. L'interprète nous parle ici du type unit car cette seconde règle souffre d'une seule exception que nous verrons dans le chapitre sur la programmation impérative.

