Le type des nombres à virgule flottantes en OCaml est float. Ils sont codés sur 64 bits selon la norme IEEE754. Les valeurs flottantes littérales se distinguent des valeurs entières par la présence d'une virgule . ou des caractères e ou E pour écrire le nombre en notation scientifique . Voici quelques exemples : let pi = 3.141592;;
let avogadro = 6.02e23;; (* signifie 6.02 x 10^23 `*) let quatre = 4. ;; (* 4. signifie 4.0 *)
let mille = 1E3;; Pour calculer avec les flottants, on utilise les opérateurs arithmétiques +., -., *., /.. L'opérateur de puissance existe sur les flottants et est noté **. Il est possible de convertir un entier en flottant à l'aide de la fonction float : int -> float (aussi nommée float_of_int). Et convertir un flottant en entier (en l'approximant) à l'aide la fonction int_of_float : float -> int. Il est bon de rappeler ici que le calcul flottant n'est pas exact et peut produire nombre d'étrangetés. Il est donc à manipuler avec précaution. L'utilisation de float pour faire du calcul entier est à proscrire.

