Les type bool sert à représenter une valeur de vérité et n'a que deux valeurs possibles : true (vrai) ou false (faux). Ce type sert le plus souvent (mais pas uniquement) à écrire des expressions boolénnes qui sont des tests pour les if et les while. Le calcul booléen se fait au travers des opérateurs logiques || (ou), && (et) ainsi que de la fonction de négation not : bool -> bool. Par exemple: let x = (true || false) && true;;
let y = (not x) &&;;
let impl a b = b || (not a)
;; L'évaluation de || et && est paresseuse , c'est-à-dire que pour évaluer expr1 || expr2, OCaml évalue d'abord expr1 et si le résultat est true retourne directement true sans évaluer expr2. De même, pour évaluer expr1 && expr2, OCaml évalue d'abord expr1 et si le résultat est false retourne directement false sans évaluer expr2.

