En plus des valeurs littérales telles que 4242, un expression peut faire intervenir des valeurs possédant un nom comme par exemple 2 * x + 5 ou largeur * longueur. Bien évidemment, si on demande à OCaml d'évaluer tout de suite une telle expression, on obtient une erreur : # 2 * x + 5;;
Error: Unbound value x qui signifie que le nom x n'est lié à aucune valeur dans l'environnement, autrement dit, OCaml ne connaît pas la valeur de x. L' environnement est le contexte d'évaluation des expressions qui associe à chaque nom sa valeur littérale. Pour pouvoir évaluer cette expression, il faut d'abord définir sa valeur dans l'environnement à l'aide du mot clé let : let x = 3;; l'interprète OCaml répond alors : val x : int = 3 signfiant que l'expression est de type int, son évaluation donne la valeur 3 qui est ajoutée à l'énvironnement sous le nom x. Il est maintenant possible d'évaluer l'expression précédente : # 2 * x + 5;;
- : int = 11

