Plus généralement, la syntaxe d'une définition globale est let nom = expression;; où le résultat de l'évaluation de l'expression sera lié dans la suite du programme à l'environnement global sous le nom nom. Par exemple : let longueur = 5;;
let largeur = 12;;
let perimetre = (longueur + largeur) * 2;;
let aire = longueur * largeur;; La syntaxe OCaml spécifie qu'un nom de valeur doit commencer par une lettre minuscule ou _, et ne contenir que des lettres, des chiffres et des caractères _. Typiquement, un nom de variable s'écrit donc avec la convention snake case par exemple : nom_de_valeur.

7.body:
Lorsqu'on donne un nom à une valeur, celle-ci est en général utilisée dans une petite partie de code et non pas dans le programme en entier. De manière générale lorqu'on programme, on se concentre sur une très petite portion de code et on ignore quels noms de valeurs ont été ou seront utilisés ailleurs dans le programme. L'utilisation de définitions locales permet d'éviter de surcharger l'environnement global. De plus, on évite aussi de masquer involontairement une valeur globale ou d'utiliser un nom qui pourrait être masqué par une autre définition globale. C'est donc une bonne pratique de programmation d'utiliser des définitions locales dès que cela s'avère possible. Pour définir une valeur localement on utilise les mots clefs let et in ainsi : let x = 5 in 2 * x + 1;; l'interprète répond alors : - : int = 11 A première vue, tout semble se passer comme pour une définition globale mais ce n'est pas le cas : let x = 4 in 2 * x + 1;;
x * x + 2;; produira l'erreur Unbound value x à la deuxième ligne car x a été uniquement défini localement à l'expression 2 * x + 1. Il est également possible de définir plusieurs valeurs locales en enchaînant les let .. in : let longueur = 3 in
let largeur = 5 in
longueur * largeur;;

