Pour bien comprendre le let ... in revenons à la représentation sous forme de pile de l'environnement. Lorsqu'on utilise let x = expr1 in expr2 la valeur de expr1 sera temporairement liée au nom x lors de l'évaluation de expr2. Concrètement, cela signifie qu'on empilera la valeur x dans l'environnement avant d'évaluer expr2, puis immédiatement, cette valeur sera dépilée de l'environnement. Etudions cela sur un exemple : let a = 5;;
let b = 3 + 4;;
let a = 17 in a + b;;
a * b;; Après l'évaluation des deux premières expressions, la pile d'environnement vaut : Environnement b = 7 a = 5 Ensuite, l'évaluation de la troisième expression se fait dans un environnement où a = 17 a été temporairement empilée : Environnement a = 17 b = 7 a = 5 C'est pourquoi le résultat de l'évaluation de la 3e expression donnera 24. La valeur précédente de a est temporairement masquée . Puis, l'association a = 17 est dépilée pour l'évaluation de la dernière expression et a retrouve sa valeur prédente. Le résultat sera donc 35.
